import React from 'react';
import { useEffect } from 'react';
import { useState } from 'react';

function NavBar() {
  let [current_id, setCurrentId] = useState();
    useEffect(() => {
        const data = window.localStorage.getItem("current_id");
        if  ( data !==null) setCurrentId(JSON.parse(data));
    }, []);

  function cerrar() {
    current_id = 100;
    window.localStorage.setItem("current_id", JSON.stringify(current_id));
  }
  if (current_id == 100) {
    return (
      <div className="navbar">
        <div>
          <a href="/">
            <img src={require("../imgs/logo_casa.png")} alt="Imagen"></img></a>
          <a href="./quienes-somos">Quienes somos</a>
          <a href="acerca-de">Acerca de</a>
          <a href="/reglas-negocio">Reglas de Negocio</a>

          <div class="dropdown">
            <a href="/simulador">Simular</a>
            <div class="dropdown-content">
              <a href="/simulador">Chocolate</a>

              <br></br>
            </div>
          </div>
        </div>
        <div>

          <a id="l1" href="/login">
            <button className="btn btn-primary btn-lg">Log In</button>
          </a>

          <a id="l1" href="/registrarse">
            <button className="btn btn-primary btn-lg">Registrarse</button>
          </a>

        </div>
      </div>)
  }
  else {// Usuario Registrado
    return(
          <div className="navbar">
        <div>
          <a href="/"> 
            <img src={require("../imgs/logo_casa.png")} alt="Imagen" ></img></a>
          <a href="./quienes-somos">Quienes somos</a>
          <a href="acerca-de">Acerca de</a>
          <a href="/reglas-negocio">Reglas de Negocio</a>

          <div class="dropdown">
            <a href="/simulador">Simular</a>
            <div class="dropdown-content">
              <a href="/simulador">Chocolate</a>

              <br></br>
            </div>
          </div>
        </div>
        <div>
          <a href="/" className='user1'>
            <img src={require("../imgs/user12.png")} alt="Imagen" className='user1'></img></a>
            <a href="/">

          <button className="btn btn-primary btn-lg" onClick={cerrar}>Cerrar Sesion</button>
            </a>
        </div>


      </div>)
  }

}

export default NavBar;
